"use strict";import FormulaProcessor from"../FormulaProcessor.js";const{getArgumentsValues}=FormulaProcessor;function PRODUCT(args,table){const values=getArgumentsValues(args,table);let result=1,calculated=false;for(let i=0,iEnd=values.length,value;i<iEnd;++i){value=values[i];switch(typeof value){case"number":if(!isNaN(value)){calculated=true;result*=value}break;case"object":calculated=true;result*=PRODUCT(value,table);break}}return calculated?result:0}FormulaProcessor.registerProcessorFunction("PRODUCT",PRODUCT);export default PRODUCT;